import React from 'react';

const Landing = () => {
  return (
      <div className='parent-container'>
        <p>Best Price Comparison Website in India

Searching for your favourite products at the best possible prices? At Price Advisor.com we give you easy access to the best deals that can help you save more money while shopping.
Shortlisting, filtering, and researching takes away a lot of time, and when you have finally decided on what you want to buy, it can get cumbersome to find the best deals on that particular product. With Amazon, Flipkart, Myntra, Paytm and other similar platforms offering varied discounts, it can also get tough to fish out the best offers. That’s when you are going to need a platform like pricee.com – a one stop solution for online price comparisons across multiple product categories.

How Do Price Comparison Sites Work?

Price comparison sites work by dynamically fetching updated prices, features, reviews, descriptions, and all essential information on various products from different e-commerce sites. All this data is then tailored in a structured manner for your easy understanding. So, when you are searching for a product, the price comparison site fetches prices and gives you results using which you can make the best purchase. Many of these price comparison sites allow browser notifications, and many even let you set alerts for price drops.</p>
      </div>
  )
}

export default Landing
